import React, { Component } from "react";
import Fullpage from "../components/Fullpage";
import data from "../data.json";
import { SocialIcon } from "react-social-icons";
import DownIcon from "../components/DownIcon";
import { Link, Element } from "react-scroll";

class TitlesAndIcons extends Component {
  constructor() {
    super();
    this.state = {
      color: "white"
    };
    this.changeColor = this.changeColor.bind(this);
    this.changeMenu = this.changeMenu.bind(this);
    this.changebutton = this.changebutton.bind(this);
  }

  changeColor() {
    this.setState({
      color: this.state.color === "white" ? "yellow" : "white"
    });
  }

  changeMenu() {
    this.setState({
      color: this.state.color === "white" ? "red" : "white"
    });
  }
  changebutton() {
    this.setState({
      color: this.state.color === "white" ? "" : "white"
    });
  }
  render() {
    return (
      <div>
        <Fullpage className="first">
        <button
            className="color"
            style={{
              color: this.state.color
            }}
            onMouseOver={this.changebutton}
            onMouseLeave={() => {
              this.changebutton();
            }}
          >
            {data.button}
          </button>

        <h5
            className="menu"
            style={{
              color: this.state.color
            }}
            onMouseOver={this.changeMenu}
            onMouseLeave={() => {
              this.changeMenu();
            }}
          >
            {data.manu}
          </h5>

          <h1
            className="title"
            style={{
              color: this.state.color
            }}
            onMouseOver={this.changeColor}
            onMouseLeave={() => {
              this.changeColor();
            }}
          >
            {data.title}
          </h1>
          <div>
            <h2> {data.Subtitle} </h2>
          </div>
          <div className="icon-wrapper">
            {Object.keys(data.links).map(key => {
              return (
                <div className="icon" key={key}>
                  <SocialIcon url={data.links[key]} />
                </div>
              );
            })}
          </div>
        </Fullpage>
        <Link
        activeClass="active"
        to="about"
        spy={true}
        smooth={true}
        offset={50}
        duration={500}
        delay={1000}
      >
      </Link>
        <DownIcon
          icon={data.icons.down}
          onClick={() => console.log("im working")}
        />
        <Element name="about" className="element">
        </Element>
      </div>
    );
  }
}

export default TitlesAndIcons;
